function toggleAll() {
    var selectAll = document.getElementById('selectAll').checked;
    document.getElementById('imdGroup').checked = selectAll;
    document.getElementById('rahatGroup').checked = selectAll;
    toggleGroup('imd');
    toggleGroup('rahat');
}

function toggleGroup(group) {
    var isChecked = document.getElementById(group + 'Group').checked;
    var selectAll = document.getElementById('selectAll');
    
    for (var district in layerNameMap) {
        var layerName = layerNameMap[district][group === 'imd' ? 0 : 1];
        map.eachLayer(function(layer) {
            if (layer.options?.name === layerName) {
                if (isChecked) {
                    map.addLayer(layer);
                } else {
                    map.removeLayer(layer);
                }
            }
        });
    }
    
    // Update Select All checkbox state
    var imdChecked = document.getElementById('imdGroup').checked;
    var rahatChecked = document.getElementById('rahatGroup').checked;
    selectAll.checked = imdChecked && rahatChecked;
}
